met de stemmen van Edward Asner, Jordan Nagai en Christopher Plummer

Carl Fredricksen heeft er zijn hele leven al van gedroomd om de wereld te ontdekken en grootse avonturen te beleven. Maar op 
78-jarige leeftijd lijkt het alsof zijn leven aan hem voorbij is gegaan en zijn de grootse avonturen alleen maar dromen geweest. 
Maar dat gaat vanaf nu veranderen als Carl besluit om zijn dromen uit te laten komen. Samen met de 8-jarige padvinder Russel gaat 
hij op avontuur.
